export function prepareHypercertUriData(
  bossId: number,
  bossName: string,
  bossLocation: string,
  bossLink: string,
  fighters: `0x${string}`[]
) {
  return {
    name: `Fight with ${bossName} for the safety of ${bossLocation} (#${bossId})`,
    description: `${bossName} is a boss that emitted CO2 and damaged the environment in ${bossLocation}. But he was defeated by valiant fighters (contributors). So ${bossLocation} is safe now.`,
    image:
      "data:image/png;base64,",
    version: "0.0.1",
    hypercert: {
      impact_scope: {
        name: "Impact Scope",
        value: ["all"],
        excludes: [],
        display_value: "all",
      },
      work_scope: {
        name: "Work Scope",
        value: ["CO2 Boss Fight"],
        excludes: [],
        display_value: "CO2 Boss Fight",
      },
      impact_timeframe: {
        name: "Impact Timeframe",
        value: [1672531200, 0],
        display_value: "2023-01-01 → indefinite",
      },
      work_timeframe: {
        name: "Work Timeframe",
        value: [1672531200, 1703980800],
        display_value: "2023-01-01 → 2023-12-31",
      },
      rights: {
        name: "Rights",
        value: ["Public Display"],
        excludes: [],
        display_value: "Public Display",
      },
      contributors: {
        name: "Contributors",
        value: fighters,
        display_value: fighters.join(", "),
      },
    },
    external_url: bossLink,
  };
}
